import styles from './styles.module.css';

const Main = () => {
    const handleLogout = () => {
        localStorage.removeItem("token");
        window.location.reload();
    };

    return (
        <div>
         <header>
            <h1>FocusFish </h1> <button className={styles.white_btn} onClick={handleLogout}>Log out</button>
        </header>   
        <div classname={styles.main_container}>
           
        
        </div>
        </div>
    )
}

export default Main;
